<!DOCTYPE html>
<html>
  <head>
    <base href="https://s3.us-west-2.amazonaws.com/dev.bespoke.ly/">
    <script src="https://s3.us-west-2.amazonaws.com/dev.bespoke.ly/flutter.js" defer></script>
    <script>
      var serviceWorkerVersion = "3435169914";
    </script>
  </head>

  <body>
  </body>

  <script>
    window.addEventListener("load", function (ev) {
      // Download main.dart.js
      _flutter.loader
        .loadEntrypoint({
          serviceWorker: {
            serviceWorkerVersion: serviceWorkerVersion,
          },
        })
        .then(function (engineInitializer) {
          return engineInitializer.initializeEngine();
        })
        .then(function (appRunner) {
          return appRunner.runApp();
        });
    });
  </script>
</html>
